import unittest
import time
from geeneus.backend import ProteinObject
from geeneus.backend import Networking
from Bio import Entrez


import random

class TestProteinObjectFunctions(unittest.TestCase):

    def setUp(self):

        self.nw = Networking.Networking(30)
        Entrez.email = "alex.holehouse@gmail.com"
        
    def test_get_isoforms1(self):

        isoforms = self.getIsoforms("Q13480")
        self.assertEqual(isoforms["Q13480-2"][1].upper(), "")

        isoforms = self.getIsoforms("P27361")
        self.assertEqual(isoforms["P27361-2"][1].upper(), "")

        self.assertEqual(isoforms["P27361-3"][1].upper(), "")
        
        isoforms = self.getIsoforms("Q96QD8")
        self.assertEqual(isoforms["Q96QD8-2"][1].upper(), "")

    def test_get_isoforms2(self):
        isoforms = self.getIsoforms("Q9UQB8")
        self.assertEqual(isoforms["Q9UQB8-2"][1].upper(), "")
        self.assertEqual(isoforms["Q9UQB8-3"][1].upper(), "")
        self.assertEqual(isoforms["Q9UQB8-4"][1].upper(), "")
        self.assertEqual(isoforms["Q9UQB8-5"][1].upper(), "")      
        self.assertEqual(isoforms["Q9UQB8-6"][1].upper(), "")


    def test_get_isoforms3(self):
        isoforms = self.getIsoforms("P16144")
        self.assertEqual(isoforms["P16144-3"][1].upper(), "")
        self.assertEqual(isoforms["P16144-3"][0], "Beta-4B")


        self.assertEqual(isoforms["P16144-4"][1].upper(), "")
        
        self.assertEqual(isoforms["P16144-5"][1].upper(), "")

        self.assertEqual(isoforms["P16144-2"][1].upper(), "")

    def getIsoforms(self, ID):
        handle = self.nw.efetchProtein(ID)
        XML = Entrez.read(handle)
        PO = ProteinObject.ProteinObject(ID, XML)
        return PO.isoforms

        
        
